const bodyParser = require('body-parser');
const neo4j = require('neo4j-driver');


app.use(bodyParser.json());

// Set up Neo4j driver connection
const driver = neo4j.driver(
  'bolt://localhost:7687', // Neo4j URI
  neo4j.auth.basic('neo4j', 'your_password') // Neo4j credentials
);

const session = driver.session();

async function searchPersonByQuery(query) {
    const session = driver.session();
  
    try {
      const result = await session.run(
        `
        MATCH (p:Person)-[:FATHER_OF]->(f:Person)-[:FATHER_OF]->(gf:Person)
        WHERE (p.name + " " + f.name + " " + gf.name + " " + p.familyName) CONTAINS $query
        RETURN p.name AS personName, f.name AS fatherName, gf.name AS grandfatherName, 
               p.familyName AS familyName, p.gender AS gender, p.age AS age, p.mother AS motherName
        LIMIT 1
        `,
        { query }
      );
  
      if (result.records.length > 0) {
        const record = result.records[0];
        return {
          personName: record.get('personName'),
          fatherName: record.get('fatherName'),
          grandfatherName: record.get('grandfatherName'),
          familyName: record.get('familyName'),
          gender: record.get('gender'),
          age: record.get('age'),
          motherName: record.get('motherName'),
        };
      } else {
        return null;
      }
    } catch (error) {
      console.error('Error executing Cypher query:', error);
      throw error;
    } finally {
      await session.close();
    }
  }


import React, { useState, useEffect } from 'react';

const SearchPage = () => {
  const [searchQuery, setSearchQuery] = useState(""); 
  const [personDetails, setPersonDetails] = useState(null); 
  const [error, setError] = useState(""); 

  const handleSearchChange = (event) => {
    setSearchQuery(event.target.value);
  };

  const fetchPersonDetails = async (query) => {
    try {
      const response = await fetch(`/api/person?query=${query}`);
      const data = await response.json();

      if (response.ok) {
        setPersonDetails(data);
        setError("");
      } else {
        setPersonDetails(null);
        setError(data.error || "لم يتم العثور على شخص مطابق.");
      }
    } catch (error) {
      console.error("Error fetching person details:", error);
      setPersonDetails(null);
      setError("حدث خطأ أثناء البحث.");
    }
  };

  useEffect(() => {
    if (searchQuery.length > 0) {
      fetchPersonDetails(searchQuery);
    } else {
      setPersonDetails(null);
      setError("");
    }
  }, [searchQuery]);

  return (
    <div className="search-page">
      {/* Search Header */}
      <header className="search-header">
        <h1>ابحث عن شخص في شجرة العائلة</h1>
        <input
          type="text"
          className="search-bar"
          placeholder="ابحث عن شخص ..."
          value={searchQuery}
          onChange={handleSearchChange}
        />
      </header>

      {/* Error Message */}
      {error && <div className="error-message">{error}</div>}

      {/* Display Person Details if found */}
      {personDetails ? (
        <div className="person-details">
          <h2>تفاصيل الشخص</h2>
          <p><strong>الاسم: </strong>{personDetails.personName}</p>
          <p><strong>اسم الأب: </strong>{personDetails.fatherName}</p>
          <p><strong>اسم الجد: </strong>{personDetails.grandfatherName}</p>
          <p><strong>اسم العائلة: </strong>{personDetails.familyName}</p>
          <p><strong>الجنس: </strong>{personDetails.gender}</p>
          <p><strong>العمر: </strong>{personDetails.age} سنة</p>
          <p><strong>الأم: </strong>{personDetails.motherName}</p>
        </div>
      ) : (
        <div className="no-results">
          <p>لا توجد نتائج للبحث.</p>
        </div>
      )}
    </div>
  );
};

export default SearchPage;
